import React from 'react';
import ReactDOM from 'react-dom/client';
import AppHeader from './components/Header/Header';
import AppGGalery from './components/GGalery/GGalery';
import AppAboutMusic from './components/AboutMusic/AboutMusic';
import AppEventSchedule from './components/EventSchedule/EventSchedule';
import AppOurSponsors from './components/OurSponsors/OurSponsors';
import Testimonials from './components/Testimonials/Testimonials';
import AppShots from './components/Shots/Shots';
import AppContactUs from './components/ContactUs/ContactUs';



const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <AppHeader/>
    <AppGGalery/>
    <AppAboutMusic/>
    <AppEventSchedule/>
    <AppOurSponsors/>
    <Testimonials/>
    <AppShots/>
    <AppContactUs/>

  </React.StrictMode>
);
